Logistic Regression Example
In this exercise, you will implement logistic regression and apply it to two different datasets.
In this part of the exercise, you will build a logistic regression model to predict whether a student gets admitted into a university.
Suppose that you are the administrator of a university department and you want to determine each applicant’s chance of admission based on their results on two exams. You have historical data from previous applicants that you can use as a training set for logistic regression. For each training example, you have the applicant’s scores on two exams and the admissions decision.
Your task is to build a classification model that estimates an applicant’s probability of admission based the scores from those two exams.
Initialize model:
clear ; close all; clc
Load Data (the first two columns contains the exam scores and the third column contains the label):
data = load('ex2data1.txt');
X = data(:, [1, 2]); y = data(:, 3);
plotData(X, y);
Put some labels:
hold on;
xlabel('Exam 1 score')
ylabel('Exam 2 score')
Specified in plot order:
legend('Admitted', 'Not admitted')
hold off;

Compute Cost Function and Gradient:
Setup the data matrix appropriately, and add ones for the intercept term:
[m, n] = size(X);
Add intercept term to x and X_test:
X = [ones(m, 1) X];
Initialize fitting parameters:
initial_theta = zeros(n + 1, 1);
Compute and display initial cost and gradient:
[cost, grad] = costFunction(initial_theta, X, y);
Compute and display cost and gradient with non-zero theta:
test_theta = [-24; 0.2; 0.2];
[cost, grad] = costFunction(test_theta, X, y);
Optimization using fminunc function
Set options for fminunc:
options = optimset('GradObj', 'on', 'MaxIter', 400);
Run fminunc to obtain the optimal theta (this function will return theta and the cost):
[theta, cost] = ...
fminunc(@(t)(costFunction(t, X, y)), initial_theta, options);
Plot Boundary:
plotDecisionBoundary(theta, X, y);
Put some labels:
hold on;
xlabel('Exam 1 score')
ylabel('Exam 2 score')

legend('Admitted', 'Not admitted')
hold off;

Predict and Accuracies:
